function ComponenteCompetencia(props) {
  return (
    <div
      style={{
        background: "#666",
        color: "white",
        while: "40%",
        marginLeft: "30%",
        padding: "auto",
        border: "2px solid yellow",
      }}
    >
      <div>
        <div>{props.nome}</div>
        <div>{props.descricao}</div>
      </div>
    </div>
  );
}
export { ComponenteCompetencia };
